static struct ssymtest test_scipher[] = {
	{ "RC4", 8, 8, rc4_data },
	{ NULL, 0, 0, NULL },
};

void bmodes(int *nt, int *sc)
{
	unsigned char key[1024], plain[1024], tmp1[1024], tmp2[1024];
	int i, j, type, ok;
	size_t klen, len, l;
	CYFER_BLOCK_CIPHER_CTX *ctx;
	CYFER_BlockMode_t *modes;

	type = CYFER_BlockCipher_Select(test_bcipher[3].name, &klen, NULL, &len);
	modes = CYFER_BlockCipher_Get_SupportedModes();

	for (l = 0; l < klen; l++) key[l] = (unsigned char) ((rand() / 256) & 255);
	for (l = 0; l < len; l++) plain[l] = (unsigned char) ((rand() / 256) & 255);

	ok = 1;
	for (i = 0; modes[i].name; i++) {
		*nt = *nt + 1;
		printf("Testing %s mode of operation ... ", modes[i].name);
		l = (modes[i].length) ? modes[i].length : len;

		for (j = 0; j < MODE_ITER; j++) {
			ctx = CYFER_BlockCipher_Init(type, key, klen, modes[i].type, NULL);
			memcpy(tmp1, plain, l);
			CYFER_BlockCipher_Encrypt(ctx, tmp1, tmp2);
			memcpy(tmp1, tmp2, l);
			CYFER_BlockCipher_Finish(ctx);

			ctx = CYFER_BlockCipher_Init(type, key, klen, modes[i].type, NULL);
			CYFER_BlockCipher_Decrypt(ctx, tmp1, tmp2);
			memcpy(tmp1, tmp2, l);
			CYFER_BlockCipher_Finish(ctx);

			if (memcmp(tmp1, plain, l)) {
				ok = 0;
				break;
			}

		}
		if (!ok) {
			printf("failed\n");
		} else {
			*sc = *sc + 1;
			printf("passed\n");
		}
	}
}


void bcipher(int *nt, int *sc)
{
	unsigned char tmp1[1024], tmp2[1024];
	int type, i, j, ok;
	size_t klen, mdlen;
	CYFER_BLOCK_CIPHER_CTX *ctx;

	for (i = 0; test_bcipher[i].name; i++) {
		type = CYFER_BlockCipher_Select(test_bcipher[i].name, &klen, NULL, &mdlen);
		if (type == CYFER_CIPHER_NONE) {
			fprintf(stderr, "Unknown algorithm `%s'\n", test_bcipher[i].name);
			continue;
		}
		*nt = *nt + 1;
		printf("Testing %s block cipher ... ", test_bcipher[i].name);

		ok = 1;
		for (j = 0; test_bcipher[i].tests[j].plain; j++) {
			ctx = CYFER_BlockCipher_Init(type, (unsigned char *) test_bcipher[i].tests[j].key, test_bcipher[i].keylen, CYFER_MODE_ECB, NULL);
			CYFER_BlockCipher_Encrypt(ctx, (unsigned char *) test_bcipher[i].tests[j].plain, tmp1);
			CYFER_BlockCipher_Decrypt(ctx, tmp1, tmp2);
			CYFER_BlockCipher_Finish(ctx);

			if (memcmp(test_bcipher[i].tests[j].cipher, tmp1, mdlen)) {
				ok = 0; break;
			} else if (memcmp(test_bcipher[i].tests[j].plain, tmp2, mdlen)) {
				ok = 0; break; 
			}
		}

		if (ok) {
			*sc = *sc + 1;
			printf("passed\n");
		} else {
			printf("failed\n");
		}
	}
}

void scipher(int *nt, int *sc)
{
	unsigned char tmp1[1024], tmp2[1024];
	int type, i, j, ok;
	size_t klen, mklen, mdlen;
	CYFER_STREAM_CIPHER_CTX *ctx;

	for (i = 0; test_scipher[i].name; i++) {
		type = CYFER_StreamCipher_Select(test_scipher[i].name, &klen, &mklen);
		if (type == CYFER_CIPHER_NONE) {
			fprintf(stderr, "Unknown algorithm `%s'\n", test_scipher[i].name);
			continue;
		}
		*nt = *nt + 1;
		printf("Testing %s stream cipher ... ", test_scipher[i].name);

		mdlen = test_scipher[i].len;

		ok = 1;
		for (j = 0; test_scipher[i].tests[j].plain; j++) {
			ctx = CYFER_StreamCipher_Init(type, (unsigned char *) test_scipher[i].tests[j].key, test_scipher[i].keylen);
			CYFER_StreamCipher_Encrypt(ctx, (unsigned char *) test_scipher[i].tests[j].plain, tmp1, mdlen);
			CYFER_StreamCipher_Finish(ctx);

			ctx = CYFER_StreamCipher_Init(type, (unsigned char *) test_scipher[i].tests[j].key, test_scipher[i].keylen);
			CYFER_StreamCipher_Decrypt(ctx, tmp1, tmp2, mdlen);
			CYFER_StreamCipher_Finish(ctx);

			if (memcmp(test_scipher[i].tests[j].cipher, tmp1, mdlen)) {
				ok = 0; break;
			} else if (memcmp(test_scipher[i].tests[j].plain, tmp2, mdlen)) {
				ok = 0; break;
			}
		}

		if (ok) {
			*sc = *sc + 1;
			printf("passed\n");
		} else {
			printf("failed\n");
		}
	}
}

